querying mongodb subarray and returning only the latest item in the subarray that fits a date range<p>I have the following schemas (removed most fields for readability):</p>
<pre><code>const BudgetItemHistorySchema = new Schema({
  amount: Number,
  modifiedOn: {
    type: Date,
    required: true
  }
})

const BudgetItemSchema = new Schema({
  projectId: {
    type: String,
    required: true,
  },
  amount: Number,
  history: {
    type: [BudgetItemHistorySchema],
    default: []
  }
});
</code></pre>
<p>I need a query that would return only the most recent item from the <code>history</code> sub-array, given if I run a query of:</p>
<pre><code>BudgetItem.find({
    'projectId': 'abc123',
    'history.modifiedOn': {
        $gte: &quot;&lt;fromDate&gt;&quot;,
        $lte: &quot;&lt;toDate&gt;&quot;
    }
});
</code></pre>
<p>I would return multiple <code>BudgetItems</code>, that may have 0 or more <code>history</code> items.</p>
<p>So, if there is more than 1 item in the <code>history</code> array, only return the most recent item, given the date range.</p>
<p>I know that I will need to use the aggregation pipeline, but I am struggling to construct a query that would only return the <code>$last</code> item of the subarray.</p>
<p>I know how to do this if I was returning the <code>$last</code> of the BudgetItems, as specified in: <a href="https://docs.mongodb.com/manual/reference/operator/aggregation/last/" rel="nofollow noreferrer">https://docs.mongodb.com/manual/reference/operator/aggregation/last/</a>, but how to do this with subarrays?</p>
<p>An example output would be:</p>
<pre><code>[{
    'projectId': 'abc123',
    'amount': 100,
    'history': [{
        '_id': 'aabbcc',
        'amount': 75,
        'modifiedOn': '&lt;latestDate&gt;'
    }]
},{
    'projectId': 'abc123',
    'amount': 700,
    'history': [{
        '_id': 'ccddee',
        'amount': 600,
        'modifiedOn': '&lt;latestDate&gt;'
    }]
}]
</code></pre>
<p>but, a more preferable output would simply be:</p>
<pre><code>[{
    'projectId': 'abc123',
    '_id': 'aabbcc',
    'amount': 75,
    'modifiedOn': '&lt;latestDate&gt;'
},{
    'projectId': 'abc123',
    '_id': 'ccddee',
    'amount': 600,
    'modifiedOn': '&lt;latestDate&gt;'
}]
</code></pre>

