MongoDB query is slow even when searching by indexes<p>I have a collection called calls containing properties <code>DateStarted, DateEnded, IdAccount, From, To, FromReversed, ToReversed</code>. In other words this is how a call document looks like:</p>
<pre><code>{
     _id : &quot;LKDJLDKJDLKDJDLKJDLKDJDLKDJLK&quot;,

     IdAccount: 123,

     DateStarted: ISODate('2020-11-05T05:00:00Z'),
     DateEnded:   ISODate('2020-11-05T05:20:00Z'),     

     From: &quot;1234567890&quot;,
     FromReversed: &quot;0987654321&quot;,

     To: &quot;1231231234&quot;,
     ToReversed: &quot;4321321321&quot;
}
</code></pre>
<p>On our website we want to give customers the option to search by custom calls. When they search for calls they must specify the <code>DateStarted</code> and <code>DateEnded</code> Those fields are required the other ones are optional. The <code>IdAccount</code> will be injected on our end so that the customer can only get calls that belong to his account.</p>
<p>Because we have about 5 million records we have created the following indexes</p>
<pre><code>db.calls.ensureIndex({&quot;IdAccount&quot;:1});
db.calls.ensureIndex({&quot;DateStarted&quot;:1});
db.calls.ensureIndex({&quot;DateEnded&quot;:1});
db.calls.ensureIndex({&quot;From&quot;:1});
db.calls.ensureIndex({&quot;FromReversed&quot;:1});
db.calls.ensureIndex({&quot;To&quot;:1});
db.calls.ensureIndex({&quot;ToReversed&quot;:1});
</code></pre>
<blockquote>
<p>The reason why we did not created a compound index is because we want to be able to search by custom criteria. For example we may want to search by all calls with date smaller than December 11 and from a specific account.</p>
</blockquote>
<p>Because of the indexes all these queries execute very fast:</p>
<pre><code>db.calls.find({'DateStarted' : {'$gte': ISODate('2020-11-05T05:00:00Z')}).limit(200).explain();
db.calls.find({'DateEnded' : {'$lte': ISODate('2020-11-05T05:00:00Z')}).limit(200).explain();
db.calls.find({'IdAccount' : 123 ).limit(200).explain();
// etc...
</code></pre>
<p>Even queries that use regexes execute very fast. They only work fast if I use <code>^...</code> meaning that it must start with a search pattern as:</p>
<pre><code>db.calls.find({  'From' : /^305/ ).limit(200).explain();
</code></pre>
<p>and that is the reason why we created the field <code>FromReversed</code> and <code>ToReversed</code>. If I want to search for a <code>To</code> phone number that ends with <code>3985</code> I will execute:</p>
<pre><code>db.calls.find({  'ToReversed' : /^5893/ ).limit(200).explain(); // note I will have to reverse the search option to
</code></pre>
<p>So the only queries that are slow are the ones that do not start with something such as this query:</p>
<pre><code>db.calls.find({  'ToReversed' : /1234/ ).limit(200).explain(); 
</code></pre>
<hr />
<h2>Question</h2>
<p>Why is it that if I combine all the queries it is very slow? For example this query is very slow:</p>
<pre><code>db.calls.find({
  'DateStarted':{'$gte':ISODate('2018-11-05T05:00:00Z')}, 
  'DateEnded':{'$lte':ISODate('2020-11-05T05:00:00Z')},   
  'IdAccount':123,   
  'ToReversed' : /^5893/
}).limit(200).explain(); 
</code></pre>
<p>The problem is the <code>'ToReversed' : /^5893/</code>. If I execute that query by itself it is really fast. Even if I put something that does not give me the limit of 200 results fast. <strong>Should I add a compound index as well? just for the scenario where it is slow</strong></p>
<p>I need to give our customers the option to search by phone numbers that end with or start with a specific criteria. The moment I add extra stuff to the query it becomes really slow.</p>
<hr />
<h2>Edit</h2>
<p>By researching on the internet if I use the <code>hint</code> option it is faster. It goes from 20 seconds to 5 seconds.</p>
<pre><code>db.calls.find({
  'DateStarted':{'$gte':ISODate('2018-11-05T05:00:00Z')}, 
  'DateEnded':{'$lte':ISODate('2020-11-05T05:00:00Z')},   
  'IdAccount':123,   
  'ToReversed' : /^5893/
}).hint({'ToReversed':1}).limit(200).explain(); 
</code></pre>
<p>This is still slow and it will be great if I can lower it to 1 second just like the simple queries take milliseconds.</p>

