</code></pre>; Answer: `TO_DATE` would force a full table scan but at least it would work. `BETWEEN` wouldn't work even with raw SQL simply because Oracle will order the strings aphabetically. Perhaps add a virtual column to the table? Or create a materialized view with the results of `TO_DATE` ? A materialized view would allow indexing the columns and avoid the full scan. Using it wouldn't require any special techniques either

